import React, { Component } from "react"

class TodoListItem extends Component {
  delete(e) {
    this.props.delete(e)
  }

  render() {
    return (
      <li>
        {this.props.todoItemName}
        <button
          value={this.props.todoItemId}
          onClick={this.delete.bind(this, props.todoItemId)}
        >
          Delete
        </button>
      </li>
    )
  }
}

export default TodoListItem
